Region::RegionClassEnum Region::toRegionClassEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("NATIONAL")) {
        return RegionClassEnum::NATIONAL;
    }
    
    if (value == utility::conversions::to_string_t("STATE")) {
        return RegionClassEnum::STATE;
    }
    
    if (value == utility::conversions::to_string_t("COUNTY")) {
        return RegionClassEnum::COUNTY;
    }
    
    if (value == utility::conversions::to_string_t("METRO_AREA")) {
        return RegionClassEnum::METRO_AREA;
    }
    
    if (value == utility::conversions::to_string_t("CITY")) {
        return RegionClassEnum::CITY;
    }
    
    if (value == utility::conversions::to_string_t("NEIGHBORHOOD")) {
        return RegionClassEnum::NEIGHBORHOOD;
    }
    
    if (value == utility::conversions::to_string_t("TERRITORY")) {
        return RegionClassEnum::TERRITORY;
    }
    
    if (value == utility::conversions::to_string_t("CUSTOM")) {
        return RegionClassEnum::CUSTOM;
    }
    
    if (value == utility::conversions::to_string_t("ZONE")) {
        return RegionClassEnum::ZONE;
    }
    
    throw std::invalid_argument("Invalid value for conversion to RegionClassEnum");
}


const utility::string_t Region::fromRegionClassEnum(const RegionClassEnum value) const
{
    switch(value)
    {
        
        case RegionClassEnum::NATIONAL: return utility::conversions::to_string_t("NATIONAL");
        
        case RegionClassEnum::STATE: return utility::conversions::to_string_t("STATE");
        
        case RegionClassEnum::COUNTY: return utility::conversions::to_string_t("COUNTY");
        
        case RegionClassEnum::METRO_AREA: return utility::conversions::to_string_t("METRO_AREA");
        
        case RegionClassEnum::CITY: return utility::conversions::to_string_t("CITY");
        
        case RegionClassEnum::NEIGHBORHOOD: return utility::conversions::to_string_t("NEIGHBORHOOD");
        
        case RegionClassEnum::TERRITORY: return utility::conversions::to_string_t("TERRITORY");
        
        case RegionClassEnum::CUSTOM: return utility::conversions::to_string_t("CUSTOM");
        
        case RegionClassEnum::ZONE: return utility::conversions::to_string_t("ZONE");
        
    }
}

